"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F54992&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Samples of amniotic fluid taken during genetic amniocentesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 280px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal amniotic fluid (left) is clear bright yellow. Dark green or brown amniotic fluid (right) indicates blood degradation products caused by prior bleeding. latter sample was obtained from patient in figure 3. Level of alpha-fetoprotein in amniotic fluid may be elevated as a result of bleeding.",
"    <div class=\"footnotes\">",
"    </div>",
