"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F86707&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Intersection syndrome location",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 335px; height: 504px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Intersection syndrome affects the dorsum of the forearm a few centimeters proximal to the wrist joint at the intersection of the muscle bellies of the abductor pollicis longus and extensor pollicis brevis, where they cross over the extensor carpi radialis longus and the extensor carpi radialis brevis tendons.",
"    <div class=\"footnotes\">",
"    </div>",
