var title_f42_35_43581="Rifampin and HAART";
var content_f42_35_43581=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Coadministration of antiretroviral drugs with RIFAMPIN",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended change in dose of antiretroviral drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended change in dose of rifampin",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Non-nucleoside reverse transcriptase inhibitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Efavirenz",
"       </td>",
"       <td>",
"        None (some experts recommend 800 mg for patients &gt;50 kg)",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Efavirenz AUC &darr; by 22 percent; no change in rifampin concentration. Efavrirenz should not be used during the&nbsp;first trimester of pregnancy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nevirapine",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and nevirapine should not be used together*",
"       </td>",
"       <td>",
"        Nevirapine AUC &darr; 37 to 58 percent and Cmin &darr; 68 percent with 200 mg twice daily dose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rilpivirine",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and rilpivirine should not be used together",
"       </td>",
"       <td>",
"        Rilpivirine AUC &darr; by 80 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Etravirine",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and etravirine should not be used together",
"       </td>",
"       <td>",
"        Marked decrease in etravirine predicted, based on data on the interaction with rifabutin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Single protease inhibitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ritonavir",
"       </td>",
"       <td>",
"        No change",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Use with caution. Ritonavir AUC &darr; by 35 percent; no change in rifampin concentration. Monitor for antiretroviral activity of ritonavir.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        fos-Amprenavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and fos-amprenavir should not be used together",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Atazanavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and atazanavir should not be used together",
"       </td>",
"       <td>",
"        Atazanavir AUC &darr; by &gt;95 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Indinavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and indinavir should not be used together",
"       </td>",
"       <td>",
"        Indinavir AUC &darr; by 89 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nelfinavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and nelfinavir should not be used together",
"       </td>",
"       <td>",
"        Nelfinavir AUC &darr; 82 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Saquinavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and saquinavir should not be used together",
"       </td>",
"       <td>",
"        Saquinavir AUC by &darr; 84 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Dual protease-inhibitor combinations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Saquinavir/ritonavir",
"       </td>",
"       <td>",
"        Saquinavir 400 mg + ritonavir 400 mg twice daily",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Use with caution; the combination of saquinavir (1000 mg twice daily), ritonavir (100 mg twice daily), and rifampin caused unacceptable rates of hepatitis among healthy volunteers.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lopinavir/ritonavir (Kaletra)",
"       </td>",
"       <td>",
"        Increase the dose of lopinavir/ritonavir (Kaletra)&nbsp;four tablets (200 mg of lopinavir with 50 mg of ritonavir) twice daily",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Use with caution; this combination resulted in hepatitis in all adult healthy volunteers in an initial study.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        \"Super-boosted\" lopinavir/ritonavir (Kaletra)",
"       </td>",
"       <td>",
"        Lopinavir/ritonavir (Kaletra)&nbsp;two tablets (200 mg of lopinavir with 50 mg of ritonavir) + 300 mg of ritonavir twice daily",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Use with caution; this combination resulted in hepatitis among adult healthy volunteers. However, there are favorable pharmacokinetic and clinical data among young children.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Atazanavir/ritonavir",
"       </td>",
"       <td colspan=\"2\">",
"        The standard dose of ritonavir-boosted atazanavir (300 mg once daily with 100 mg of ritonavir) should not be used with rifampin",
"       </td>",
"       <td>",
"        Atazanavir trough concentration by &gt;90 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tipranavir/ritonavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and tipranavir/ritonavir should not be used together",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Darunavir/ritonavir",
"       </td>",
"       <td colspan=\"2\">",
"        Rifampin and darunavir/ritonavir should not be used together",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        CCR-5 receptor antagonists",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Maraviroc",
"       </td>",
"       <td>",
"        Increase maraviroc to 600 mg twice daily",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Coadministration is not recommended. If coadmininistration is necessary, use miraviroc 600 mg twice daily. If coadministered with a strong CYP3A inhibitor, use miraviroc 300 mg twice daily.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Integrase inhibitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Raltegravir",
"       </td>",
"       <td>",
"        Dose raltegravir 800 mg twice daily. Monitor closely for virologic response.",
"       </td>",
"       <td>",
"        No change (600 mg/day)",
"       </td>",
"       <td>",
"        Raltegravir 400 mg: AUC &darr; 40 percent and Cmin &darr; 61 percent. Rifampin with raltegravir 800 mg twice daily compared with raltegravir 400 mg twice daily alone: AUC &uarr; 27 percent and Cmin &darr;&nbsp;53 percent.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     &nbsp;",
"    </p>",
"    <div class=\"footnotes\">",
"     AUC: Area under curve; Cmin: Minimum concentration.",
"     <br>",
"      <br>",
"       * DHHS advises against coadministration of rifampin with nevirapine; see text for additional discussion.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     <p>",
"      Department of Health and Human Services:",
"      <a href=\"file://www.aidsinfo.nih.gov/contentfiles/lvguidelines/adultandadolescentgl.pdf\">",
"       file://www.aidsinfo.nih.gov/contentfiles/lvguidelines/adultandadolescentgl.pdf",
"      </a>",
"      (November 21, 2012).",
"     </p>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
