" <div class=\"patTopicFancySpacer\">",
" </div>",
" <div class=\"patTopicOutline\">",
"  <div class=\"rcbBottom\">",
"   <div class=\"rcbLeft\">",
"    <div class=\"rcbRight\">",
"     <div class=\"rcbBottomLeft\">",
"      <div class=\"rcbBottomRight rcbBottomRightBottomOnly\">",
"       <div id=\"outline\">",
"        <ul>",
"         <li class=\"plainItem\">",
"          <a href=\"#H1\">",
"           INTRODUCTION",
"          </a>",
"         </li>",
"         <li class=\"plainItem\">",
"          <a href=\"#H2\">",
"           MOLLUSCUM SYMPTOMS",
